import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl, { waitUntil: 'load' });

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Find and click a product card to open the modal
    const productCard = page.locator('.product-card').first();
    await productCard.waitFor({ state: 'visible' });
    await productCard.click();

    // 2. Wait for the modal to be visible and take a screenshot
    const modalLocator = page.locator('#productModal');
    await modalLocator.waitFor({ state: 'visible' });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    const modalVisible = await modalLocator.isVisible();

    // 3. Press the Escape key to close the modal
    await page.keyboard.press('Escape');

    // 4. Wait for the modal to be hidden and take a final screenshot
    await modalLocator.waitFor({ state: 'hidden' });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_closed.png'));

    const modalHidden = await modalLocator.isHidden();

    if (!modalVisible || !modalHidden) {
        throw new Error('Modal did not open and close as expected.');
    }

    return {
      success: true,
      action: "Successfully opened a modal, closed it with the Escape key, and verified it was hidden.",
      extractedData: {
        modalWasVisible: modalVisible,
        modalIsNowHidden: modalHidden
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to close modal with Escape key",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
